script: |
  super -f text -I q3124.spq | sort > q3124.out

inputs:
  - name: q3124.spq
    data: |
      SELECT DISTINCT - 21 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 58 + col2 BETWEEN - col2 * 66 - + col0 AND + + col1 * + + CAST ( NULL AS INTEGER ) + - ( + 60 ) + + col2;
  - name: tab1

outputs:
  - name: q3124.out
    data: |
